	state = {
		infoDetails: this.props.list.isClick
	}
	render() {
		console.log(this.props.list)
		var i = this.props.list
		if(this.props.list != 0 ){
			console.log("srs")
			const {details} = this.props.list 
			var img = {
				backgroundImage: `url(${details.general.avatar})`
			}
			return(
				<div className="details">
					<div class="avatar">
			            <div class="a_img" style={img}>

			            </div>
		          	</div>
			        <div class="details_info">
			            <div class="info_block">
			                <div class="i_name">{details.general.firstName}  {details.general.lastName}</div>
			            </div>
			            <div class="info_block">
			                <div class="text-info">Ledner, Johnson and Predovic</div>
			                <div class="text-info">Investor Functionality Coordinator</div>
			            </div>
			            <div class="info_block">
			                <div class="text-info">Gerry_Hackett77@gmail.com</div>
			                <div class="text-info">(895) 984-0132</div>
			            </div>
			            <div class="info_block">
			                <div class="text-info">1520 Zemlak Cove</div>
			                <div class="text-info">New Devon</div>
			                <div class="text-info">42586-7898</div>
			                <div class="text-info">Guinea-Bissau</div>
			            </div>
			        </div>
		        </div>
			);
		}else {
			console.log("srs2")
			return <div></div>
		}

	}
}
export default Details
